import React from "react";
import Login from "../components/Login/Login.js";
import Header from "../components/Header/Header.js";
import axios from 'axios';
import { useState } from 'react';
import { useNavigate, useParams } from "react-router-dom";
import { Stack, Box } from "@mui/material";
import { EditText, EditTextarea } from 'react-edit-text';

const ManageSpecificQuiz = () => {

    const [data, setDataList] = useState([]);
    const [refresh, setRefresh] = useState(false);
    const [kviz, setKviz] = useState([]);
    const { sifKviz } = useParams();


    React.useEffect(() => {
        axios.get('http://localhost:5000/admin/getQuiz/' + sifKviz).then(json => setKviz(json.data));
        const getData = async () => {
            let dataa = (
                await axios.get('http://localhost:5000/session')
            ).data;
            //setValue(data[0]);
            setDataList(dataa);
        };
        getData().catch((err) => console.log(err));
        
        
    }, [refresh]);

    return (
        <div>
            <Header />
            <Box
                sx={{
                    display: 'flex',
                    alignItems: 'flex-start',
                    flexDirection: 'column',
                    p: 1,
                    m: 1,
                    borderRadius: 7,
                    border: '6px solid rgba(255, 165, 0, 0.5)',
                    position: 'absolute', left: '33%', top: '15%',
                    padding: '30px 30px 30px 30px',
                    borderColor: 'orange'
                }}>

                <Stack direction='row' justifyContent='center' alignItems='center' spacing='1rem'>
                    <p> Naziv kviza: <EditText defaultValue = {kviz.name}/></p>
                </Stack>
                <Stack direction='row' justifyContent='center' alignItems='center' spacing='1rem'>
                    <p> Kratki opis kviza: <EditText defaultValue = {kviz.description}/> </p>
                </Stack>
                <Stack direction='row' justifyContent='center' alignItems='center' spacing='1rem'>
                    <p>Kategorija: <EditText defaultValue = {kviz.nazivKategorije}/></p>
                </Stack>
                <Stack direction='row' justifyContent='center' alignItems='center' spacing='1rem'>
                    <p>Trajanje u sekundama: <EditText defaultValue = {kviz.durationSec}/></p>
                </Stack>
                <Stack direction='row' justifyContent='center' alignItems='center' spacing='1rem'>
                    <p>Trajanje pregleda u sekundama: <EditText defaultValue = {kviz.reviewDurationSec}/></p>
                </Stack>
                
            </Box>
        </div>
    );
};

export default ManageSpecificQuiz;
